The global configuration is loaded from sightglass.toml file. This can be changed using the -c command-line flag. The configuration lists implementations to be benchmarked: test_suites = [ { name = "test1", library_path = "implementation1.so" }, { name = "test2", library_path = "implementation2.so" }
] Individual test suites can also run a command in order to be optionally skipped if that command returns a non-zero exit code: test_suites = [ { name = "test1", library_path = "implementation1.so" }, { name = "test2", library_path = "implementation2.so", guard = ["/opt/sg/guard-scripts/check", "arg1", "arg2"] }
] Additional properties that the file can include: single_core = <bool>: set to true in order to run the tests on a single CPU core, in order to get more accurate results. This only works on Linux. output = [ { format = "Text|CSV|JSON" [, file = <file>] [, breakdown = <bool>] } ... ]: how to store or display the results. By defaut, the Text and CSV output do not include a breakdown of the time spent in individual functions for tests made of multiple functions. This can be changed with the optional breakdown property being set to true. The JSON output always includes this information.

